import styles from "./NavMenu.module.scss";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";



import { NavLink } from 'react-router-dom';
const token = localStorage.getItem("food-token")
const NavMenu = () => {
    return (

        <Navbar className={styles.Navbar} collapseOnSelect expand="lg" bg="success" variant="dark">
            <Container className={styles.navContainer} >
                <Navbar.Brand className='application'>our application</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">


                    <Nav className="me-auto">


                        <Nav.Link

                            className={styles.navItem}
                            as={NavLink}
                            eventKey={1}
                            to="/">
                            Home

                        </Nav.Link>





                        <Nav.Link

                            className={styles.navItem}
                            as={NavLink}
                            eventKey={1}
                            to="/nutrition-analysis">
                            Nutrition analysis

                        </Nav.Link>



                        <Nav.Link

                            className={styles.navItem}
                            as={NavLink}
                            eventKey={1}
                            to="/recipes">
                            Recipes
                        </Nav.Link>



                        <Nav.Link

                            className={styles.navItem}
                            as={NavLink}
                            eventKey={1}
                            to="/bmi">
                            BMI

                        </Nav.Link>


                        <Nav.Link

                            className={styles.navItem}
                            as={NavLink}
                            eventKey={1}
                            to="/articles">
                            Articles
                        </Nav.Link>



                    </Nav>


                    {token ? (<Nav>

                        <Nav.Link


                            className={styles.navItem}
                            as={NavLink}
                            eventKey={2} to="/logout"
                            onClick={(e) => {
                                localStorage.removeItem('food-token');
                                window.location = '/'
                            }}

                        >Logout</Nav.Link>


                    </Nav>) : (<Nav>


                        <Nav.Link
                            className={[styles.navItemLogin].join(' ')}

                            as={NavLink}
                            eventKey={1}
                            to="/login">
                            Login
                        </Nav.Link>




                        <Nav.Link
                            className={[styles.navItemLogin].join(' ')}
                            as={NavLink}
                            eventKey={1}
                            to="/register">
                            Register
                        </Nav.Link>



                    </Nav>)}




                </Navbar.Collapse>
            </Container>
        </Navbar>




    )

};

export default NavMenu;
